import React from 'react';
import classes from './App.module.scss';

import List from '../components/List/List';

class App extends React.Component {
  items = [
    {
      id: '12345',
      text: 'this is item 1',
    },
    {
      id: '45678',
      text: 'this is item 2',
    }
  ];

  render() {
    return (
      <div className={classes.App}>
        <List></List>
      </div>
    );
  }
}

export default App;
